(function() {
  $(".page-js").ready(function() {
    var $container;
    $(function() {
      $("#da-slider").cslider({
        autoplay: true,
        interval: 8000
      });
    });
    $(".flex-image").flexslider({
      direction: "vertical",
      controlNav: false,
      directionNav: true,
      pauseOnHover: true,
      slideshowSpeed: 10000
    });
    $(".testi-flex").flexslider({
      direction: "vertical",
      controlNav: true,
      directionNav: false,
      pauseOnHover: true,
      slideshowSpeed: 8000
    });
    $(".about-flex").flexslider({
      direction: "vertical",
      controlNav: true,
      directionNav: false,
      pauseOnHover: true,
      slideshowSpeed: 8000
    });
    $(document).ready(function() {
      var recent;
      recent = $("#owl-recent");
      recent.owlCarousel({
        autoPlay: 3000,
        items: 4,
        mouseDrag: false,
        pagination: false
      });
      $(".next").click(function() {
        recent.trigger("owl.next");
      });
      $(".prev").click(function() {
        recent.trigger("owl.prev");
      });
    });
    $("#slist a").click(function(e) {
      e.preventDefault();
      $(this).next("p").toggle(200);
    });
    $("#price-tip1").tooltip();
    $(document).ready(function() {
      $(".totop").hide();
      $(function() {
        $(window).scroll(function() {
          if ($(this).scrollTop() > 400) {
            $(".totop").fadeIn();
          } else {
            $(".totop").fadeOut();
          }
        });
        $(".totop a").click(function(e) {
          e.preventDefault();
          $("body,html").animate({
            scrollTop: 0
          }, 500);
        });
      });
    });
    $container = $("#portfolio");
    $container.isotope();
    $("#filters a").click(function() {
      var selector;
      selector = $(this).attr("data-filter");
      $container.isotope({
        filter: selector
      });
      return false;
    });
    jQuery(".prettyphoto").prettyPhoto({
      overlay_gallery: false,
      social_tools: false
    });
  });

}).call(this);
